package Algorithm

import "testing"

func TestReverseString(t *testing.T) {
	t.Run("ReverseString(hello)", func(t *testing.T){
		if res := ReverseString("hello"); res != "olleh" {
			t.Fatalf("wanted olleh, got %s", res)
		}
	})
	t.Run("ReverseString(hello world)", func(t *testing.T){
		expected := "dlrow olleh"
		if res := ReverseString("hello world"); res != expected {
			t.Fatalf("wanted %s, got %s",expected, res)
		}
	})

	t.Run("ReverseString(helloworld)", func(t *testing.T){
		expected := "dlrowolleh"
		if res := ReverseString("helloworld"); res != expected {
			t.Fatalf("wanted %s, got %s",expected, res)
		}
	})

	t.Run("ReverseString(helloworld*100)", func(t *testing.T){
		expected := "dlrowolleh"
		if res := ReverseString(""); res != expected {
		}
	})


	t.Run("ReverseString()", func(t *testing.T){
		expected := ""
		if res := ReverseString(""); res != expected {
			t.Fatalf("wanted %s, got %s",expected, res)
		}
	})
}

