func TestReverseString_3(t *testing.T) {

	tests := []struct {
		input string
		expected string
	} {
		{"hello", "olleh"},
		{"helloworld", "dlrowolleh"},
		{"hello world", "dlrow olleh"},
		{"", ""},
		{"hello there world", "dlrow ereht olleh"},
		{"h", "h"},
	}
	for _, tc := range tests {
		t.Run(tc.input, func(t *testing.T) {
			if res := ReverseString_3(tc.input); res != tc.expected {
				t.Fatalf("Expected %s, got %s", tc.expected, res)
			}
		})
	}
}
